import React from 'react'
import Header from '../components/Header';
import Footer from '../components/Footer'
import '../components/css/Home.css';
import data from "../assets/headshots/headshots"

export default function Members() {
    let divs = [];
    data.forEach((obj) => {
        let name = obj.name;
        let image = obj.photo;
        let role = obj.role;
        if (role == "President" || role == "Vice President") {
            divs.push(<div className="member-card col-lg-6 col-md-12">
            <div className="member-image"><img src={image} alt={name}/></div>
            <h2>{name}</h2>
            <h4>{role}</h4>
            </div>);
        } else {
            divs.push(<div className="member-card col-lg-4 col-md-12">
            <div className="member-image"><img src={image} alt={name}/></div>
            <h2>{name}</h2>
            <h4>{role}</h4>
            </div>);
        }

    })


    return (
        <div>
            <Header />
            <div className="members-container row">{divs}</div>

            <Footer />            
        </div>
    )
}
